function App() {
  return (
    /* The screen starts here */
    <div style={{ width: "100%", height: "100%", position: "relative" }}>
      <img
        className="bg_image"
        style={{
          width: 916,
          height: 578,
          left: 0,
          top: 0,
          position: "absolute",
          borderRadius: 20,
          border: "1px black solid",
        }}
        src="https://img.rawpixel.com/s3fs-private/rawpixel_images/website_content/rm428-0019-x.jpg?w=800&dpr=1&fit=default&crop=default&q=65&vib=3&con=3&usm=15&bg=F4F4F3&ixlib=js-2.2.1&s=16c4ed18afc4ccfb86f468a829d23a1d"
        alt="Loading..."
      />
      <div style={{ width: "100%", height: "100%", position: "relative" }}>
        <div
          className="topbar"
          style={{
            width: 871.78,
            height: 71,
            left: 15,
            top: 20,
            position: "absolute",
            background: "white",
            borderRadius: 20,
            border: "1px black solid",
          }}
        ></div>
        <DateTime></DateTime>

        <div
          className="weather"
          style={{
            width: 190.35,
            height: 24.29,
            left: 96.94,
            top: 42,
            position: "absolute",
            color: "black",
            fontSize: 20,
            fontFamily: "Lusitana",
            fontWeight: "400",
            wordWrap: "break-word",
          }}
        >
          78* F, Mostly Sunny
        </div>
        <div
          className="weather-icon"
          style={{
            width: 46.7,
            height: 41.11,
            left: 35,
            top: 36,
            position: "absolute",
            background: "#FEF40A",
            borderRadius: 9999,
          }}
        />
      </div>
      <div
        style={{
          width: 320,
          height: 53,
          left: 21,
          top: 103,
          position: "absolute",
        }}
      >
        <div
          className="hello_bg"
          style={{
            width: 235,
            height: 44,
            left: 0,
            top: 0,
            position: "absolute",
            background: "white",
            borderRadius: 20,
          }}
        />
        <div
          className="hello"
          style={{
            width: 306,
            height: 49,
            left: 14,
            top: 4,
            position: "absolute",
            color: "black",
            fontSize: 30,
            fontFamily: "Lusitana",
            fontWeight: "400",
